import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { EducacionComponent } from './componentes/educacion/educacion.component';
import { ProyectosComponent } from './componentes/proyectos/proyectos.component';
import { HeaderComponent } from './componentes/header/header.component';
import { BannerComponent } from './componentes/banner/banner.component';
import { NavBarComponent } from './componentes/nav-bar/nav-bar.component';
import { SobreMiComponent } from './componentes/sobre-mi/sobre-mi.component';
import { HardSkillsComponent } from './componentes/hard-skills/hard-skills.component';
import { SoftsSkillsComponent } from './componentes/softs-skills/softs-skills.component';
import { LoginComponent } from './componentes/modal-login/login.component';
import { ImgPerfilComponent } from './componentes/modal-img-perfil/img-perfil.component';

@NgModule({
  declarations: [
    AppComponent,
    EducacionComponent,
    ProyectosComponent,
    HeaderComponent,
    BannerComponent,
    NavBarComponent,
    SobreMiComponent,
    HardSkillsComponent,
    SoftsSkillsComponent,
    ModalLoginCom,
    ImgPerfilComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
